  selector: 'app-portfolio',
  standalone: true,
  imports: [InfoSectionComponent],
  templateUrl: './portfolio.component.html',
  styleUrl: './portfolio.component.scss',
})
export class PortfolioComponent {}
<app-info-section
  headline="Lincoln Township Local Government Website"
  copy="We provide amazing services to help your business grow."
  imageSrc="../../../../../assets/jpg/LincolnTownship.jpeg"
  imageAlt="Description of the image"
></app-info-section>
